import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('domcontentloaded');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for products to load and add multiple items to cart
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Add first product to cart
    const firstProduct = await page.$('.product-card:first-child');
    await firstProduct.waitForSelector('.add-to-cart');
    await firstProduct.click('.add-to-cart');

    // Add second product to cart
    const secondProduct = await page.$('.product-card:nth-child(2)');
    await secondProduct.waitForSelector('.add-to-cart');
    await secondProduct.click('.add-to-cart');

    // Add third product to cart
    const thirdProduct = await page.$('.product-card:nth-child(3)');
    await thirdProduct.waitForSelector('.add-to-cart');
    await thirdProduct.click('.add-to-cart');

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_items_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_items_added.png'));

    // Open cart modal
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for cart to open and take screenshot
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_open.png'));

    // Modify cart items rapidly
    await page.waitForSelector('.cart-item', { timeout: 5000 });

    // Increase quantity of first item
    const firstItemPlus = await page.$('.cart-item:first-child .quantity-btn:last-child');
    await firstItemPlus.click();

    // Remove second item
    const secondItemRemove = await page.$('.cart-item:nth-child(2) .remove-item');
    await secondItemRemove.click();

    // Wait for cart to update and take final screenshot
    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_cart_modified.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_cart_modified.png'));

    // Extract cart data
    const cartCount = await page.textContent('#cartCount');
    const cartTotal = await page.textContent('#cartTotal');

    return {
      success: true,
      action: "Performed rapid cart manipulation stress test: added 3 items, modified quantities, and removed items",
      extractedData: {
        finalCartCount: cartCount,
        finalCartTotal: cartTotal
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete rapid cart manipulation stress test",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
